// Copyright 2017-2021 @polkadot/types authors & contributors
// SPDX-License-Identifier: Apache-2.0
import { UInt } from "../codec/UInt.js";
/**
 * @name u16
 * @description
 * A 16-bit unsigned integer
 */

export class u16 extends UInt.with(16) {
  constructor(...args) {
    super(...args);
    this.__UIntType = 'u16';
  }

}
